export const CROP_PERCENT = 0.2;

export default class MICRScanner {
	#cv = null;
	#referenceMap = null;
	
	constructor(cv) {
		if(cv === null || typeof cv !== 'object')
			throw new TypeError('cv must be an object.');

		this.#cv = cv;
		this.#referenceMap = this.getReferenceMap();
	}
	get cv() {
		return this.#cv;
	}
	matVectorToArray(matVector) {
		if(!(matVector instanceof this.cv.MatVector))
			throw new TypeError('matVector must be an OpenCV MatVector object.');
		const out = [];
		for(let i = 0; i < matVector.size(); i++)
			out.push(matVector.get(i));
		return out;
	}
	scanImage(img) {
		if(!(img instanceof this.cv.Mat))
			throw new TypeError('img must be an OpenCV Mat object.');
		
		// crop the bottom of the image
		const rect = new this.cv.Rect(0, img.rows - Math.round(img.rows * CROP_PERCENT), img.cols, Math.round(img.rows * CROP_PERCENT));
		const cropped = img.roi(rect);
		
		// convert to grayscale
		this.cv.cvtColor(cropped, cropped, this.cv.COLOR_RGB2GRAY);
		
		// find dark regions against a light background
		const rectKernel = this.cv.getStructuringElement(this.cv.MORPH_RECT, new this.cv.Size(25, 7));
		this.cv.morphologyEx(cropped, cropped, this.cv.MORPH_BLACKHAT, rectKernel);
		
		// closing operation to close the gaps between numbers
		this.cv.morphologyEx(cropped, cropped, this.cv.MORPH_CLOSE, rectKernel);
		
		// binarize & invert the image
		this.cv.threshold(cropped, cropped, 0, 255, this.cv.THRESH_BINARY | this.cv.THRESH_OTSU);
		
		// Find contours
		const contours = new this.cv.MatVector();
		const hierarchy = new this.cv.Mat();
		this.cv.findContours(cropped, contours, hierarchy, this.cv.RETR_EXTERNAL, this.cv.CHAIN_APPROX_SIMPLE);

		// filter out unwanted contours & sort left to right
		const filtered = this.matVectorToArray(contours)
			.filter(contour => {
				const rect = this.cv.boundingRect(contour);
				// exclude contours touching edges
				if(rect.x === 0 || rect.y === 0 || (rect.x + rect.width) === cropped.cols || (rect.y + rect.height) === cropped.rows)
					return false;
				// exclude contours that are taller than wide
				if(rect.height > rect.width)
					return false;
				// exclude contours less than 3% of height
				if(rect.height/img.rows < .03)
					return false;
				// exclude contours less than 6% of width
				if(rect.width/img.cols < .06)
					return false;
				return true;
			})
			.sort((a, b) => this.cv.boundingRect(a).x - this.cv.boundingRect(b).x);

		// collect recognized strings of MICR text
		const strings = [];
		for(const contour of filtered) {
			// get a bounding box of the contour
			const rect = this.cv.boundingRect(contour);

			// add the uncropped image height
			rect.y += img.rows - Math.round(img.rows * CROP_PERCENT);
			
			// crop the rect from the original image
			const src = img.roi(rect);
			const group = new this.cv.Mat();
			
			// convert to grayscale
			this.cv.cvtColor(src, group, this.cv.COLOR_RGB2GRAY);
			
			// binarize the image
			this.cv.threshold(group, group, 0, 255, this.cv.THRESH_BINARY_INV | this.cv.THRESH_OTSU);
			
			// find the contours
			const contours = new this.cv.MatVector();
			const hierarchy = new this.cv.Mat();
			this.cv.findContours(group, contours, hierarchy, this.cv.RETR_EXTERNAL, this.cv.CHAIN_APPROX_SIMPLE);
			
			// convert contours to an array and sort left to right
			const checkContours = this.matVectorToArray(contours).sort((a, b) => this.cv.boundingRect(a).x - this.cv.boundingRect(b).x);
			
			// extract the mats representing characters
			const characterMats = this.extractCharacterMats(group, checkContours);
			const chars = [];
			for(const characterMat of characterMats) {
				const maxVals = [];
				
				// match the character mat against the reference map of characters
				for(const char of MICR_CHARS) {
					const dst = new this.cv.Mat();
					const mask = new this.cv.Mat();
					this.cv.matchTemplate(characterMat, this.#referenceMap[char], dst, this.cv.TM_CCOEFF, mask);

					// collect the maxVal property
					const { maxVal } = this.cv.minMaxLoc(dst);
					maxVals.push(maxVal);

					// clean up
					mask.delete();
					dst.delete();
				}

				// add the character to the collected characters
				chars.push(MICR_CHARS[
					// locate the corresponding character by index
					maxVals.indexOf(
						//get the highest value in the array
						maxVals.reduce((datBigBoi, maxVal) => maxVal > datBigBoi ? maxVal : datBigBoi, -1)
					)
				]);
			}
			
			// add the detected string to the list of strings
			strings.push(chars.join(''));

			// clean up
			for(const mat of characterMats)
				mat.delete();
			hierarchy.delete();
			contours.delete();
			group.delete();
			src.delete();
		}

		// clean up
		hierarchy.delete();
		contours.delete();
		cropped.delete();
		
		return strings;
	}
	getReferenceMap() {
		const map = {};
		for(const key of Object.keys(REFERENCE_MAP)) {
			// convert the integer array into a 36 x 36 single channel Mat.
			map[key] = this.cv.matFromArray(36, 36, cv.CV_8UC1, REFERENCE_MAP[key]);
		}
		return map;
	}
	async generateReferenceMap(document) {
		if(!(document instanceof Document))
			throw new TypeError('document must be an instance of Document.');
		
		let mat, contours, hierarchy, characterMats;
		try {
			//load the reference image
			const referenceImage = document.createElement('img');
			referenceImage.src = MICR_REFERENCE;
			
			//wait for the image to load
			await new Promise(resolve => referenceImage.onload = resolve);
			
			// load the image into a Mat
			mat = this.cv.imread(referenceImage);
			
			// convert to grayscale
			this.cv.cvtColor(mat, mat, this.cv.COLOR_RGB2GRAY);
			
			// binary inverse threshold
			this.cv.threshold(mat, mat, 0, 255, this.cv.THRESH_BINARY_INV | this.cv.THRESH_OTSU);
			
			// find contours
			contours = new this.cv.MatVector();
			hierarchy = new this.cv.Mat();
			this.cv.findContours(mat, contours, hierarchy, this.cv.RETR_EXTERNAL, this.cv.CHAIN_APPROX_SIMPLE);
			
			// sort contours from left to right
			const contoursArray = this.matVectorToArray(contours);
			contoursArray.sort((a, b) => this.cv.boundingRect(a).x - this.cv.boundingRect(b).x);
			
			// extract the MICR character images
			characterMats = this.extractCharacterMats(mat, contoursArray);

			// build a hash
			const referenceMap = MICR_CHARS.reduce((chars, char, index) => {
				chars[char] = characterMats[index];
				console.log(char, characterMats[index].rows, characterMats[index].cols, characterMats[index].channels())
				return chars;
			}, {});
			
			return referenceMap;
		}
		catch(err) {
			// clean up in case of error
			if(characterMats)
				for(const characterMat of characterMats)
					characterMat.delete();
			
			throw err;
		}
		finally {
			// always clean up
			hierarchy?.delete();
			contours?.delete();
			mat?.delete();
		}
	}
	extractCharacterMats(mat, contours) {
		const characterMats = [];
		try {
			if(!(mat instanceof this.cv.Mat))
				throw new TypeError('mat must be an OpenCV Mat object.');
			if(!Array.isArray(contours))
				throw new TypeError('contours must be an Array.');
			
			if(contours.filter(contour => !(contour instanceof this.cv.Mat)).length > 0)
				throw new TypeError('contours Array may only contain OpenCV Mat objects.');
			
			// determine the largest area of the contours
			const maxArea = contours
				.map(contour => {
					const { width, height } = this.cv.boundingRect(contour);
					return width * height;
				})
				.reduce((max, cur) => cur > max ? cur : max, 0);
			
			// loop over our the contours
			for(let i = 0; i < contours.length; i++) {
				const contour = contours[i];
				const rect = this.cv.boundingRect(contour);

				// digits are larger contours. Make sure the area of the contour
				// is at least 50% of the largest contour
				if(rect.width * rect.height / maxArea >= 0.5)
					characterMats.push(mat.roi(rect));
				
				// symbols are comprised of three smaller contours
				else {
					// grab a slice of this contour and the next two
					const parts = contours.slice(i, i+3);

					//calculate the top left & bottom right coords to contain all three contours
					const points = parts.reduce((points, contour) => {
						const _rect = this.cv.boundingRect(contour);
						points.x = _rect.x < points.x ? _rect.x : points.x;
						points.y = _rect.y < points.y ? _rect.y : points.y;
						points.x2 = (_rect.x + _rect.width) > points.x2 ? (_rect.x + _rect.width) : points.x2;
						points.y2 = (_rect.y + _rect.height) > points.y2 ? (_rect.y + _rect.height) : points.y2;
						return points;
					}, { x: mat.cols, y: mat.rows, x2: 0, y2: 0 });
					
					// calculate a rect
					const rect = {
						x: points.x,
						y: points.y,
						width: points.x2 - points.x,
						height: points.y2 - points.y
					};

					// add the character mat
					characterMats.push(mat.roi(rect));

					// skip the next two iterations since we've consumed them already
					i += 2;
				}
			}

			// scale the character mats to uniform dimensions
			for(const characterMat of characterMats)
				this.cv.resize(characterMat, characterMat, new this.cv.Size(36, 36));

			return characterMats;
		}
		catch(err) {
			// clean up in case of error
			for(const characterMat of characterMats)
				characterMat.delete();

			throw err;
		}
	}
}
